import React from 'react';
import Header from './components/Header';
import useGlobalStyle from './hooks/useGlobalStyle';

export default function App() {
  const GlobalStyle = useGlobalStyle();

  return (
    <>
      <GlobalStyle />
      <Header />
    </>
  );
}
